#include"electron_physics.h"

/*Return electron stopping power S (units=MeV/cm) as array via table lookup and */
/*linear interpolation*/
/*Inputs:*/
/*  E: array featuring energy levels in MeV, ranging from 5e-5 MeV to 1000MeV*/
/*  material: Integer from following range with atomic numbers in parens*/
	  /*104: Air(7.2620)	118: Blood(3.4532)*/
	  /*119: Bone(4.4082)	202: Muscle(3.4715)*/
	  /*251: Skin(3.4125)	262: Tissue(3.3527)*/
	  /*278: Water(10)*/
/*  version: integer either 1 = 'col' or 2 = 'tot' corresponding to collision stopping */
	 /*power and collision+radiative stopping power, respectively*/

void stopping_power_electrons(double* E,
			      int length_E,
			      int material,
			      int version,
			      double* S)
{
    int i, j, lower, upper;
    double theta;

    /*int length_E = sizeof(E)/sizeof(double);*/

    double Etab[111] = { 5e-05,6e-05,7e-05,8e-05,9e-05,0.0001,0.000125,0.00015,0.000175,0.0002,0.000250,.0003,0.00035,0.0004,0.00045,0.0005,0.0006,0.0007,0.0008,0.0009,0.001, 0.00125,0.0015,0.00175,0.002,0.0025,0.003,0.0035,0.004,0.00450,0.00500,0.00600, 0.00700,0.00800,0.00900,0.0100,0.0125,0.0150,0.0175,0.0200,0.0250,0.0300,0.0350, 0.0400,0.0450,0.0500,0.0600,0.0700,0.0800,0.0900,0.100,0.125,0.150,0.175,0.200, 0.250,0.300,0.350,0.400,0.450,0.500,0.600,0.700,0.800,0.900,1.0,1.25,1.50,1.75, 2.0,2.50,3.0,3.50,4.0,4.50,5.0,6.0,7.0,8.0,9.0,10.0,12.5,15.0,17.5,20.0,25.0,30.0,35.0,40.0,45.0, 50.0,60.0,70.0,80.0,90.0,100.0,125.0,150.0,175.0,200.0,250.0,300.0,350.0,400.0,450.0,500.0,600.0, 700.0,800.0,900.0,1000.0 };

    double* Stab;

    Stab = data_sp_elec(material,version);
	    
    lower = 0;
    upper = 110;

    for (i=0;i<length_E;i++) {
	while (lower < upper-1) {
	    j = ceil((upper+lower)/2);
	    if (E[i]<=Etab[j])
		upper = j;
	    else
		lower = j;
	}
	if (E[i]==Etab[lower])
	    S[i]=Stab[lower];
	else if (E[i]==Etab[upper])
	    S[i]=Stab[upper];
	else {
	    theta=(E[i]-Etab[upper])/(Etab[lower]-Etab[upper]);
	    S[i]=theta*Stab[lower]+(1.0-theta)*Stab[upper];
	}
    
    lower=0;
    upper=110; 
    }
}

